            <td>{usuario.lastName}</td>
            <td>{usuario.status}</td>
            <td>{usuario.status==='Disconnected' ? <i  class="bi bi-toggle2-off" onClick={changeStatus}></i>:<i  class="bi bi-toggle2-on" onClick={changeStatus}></i>}</td>
        </tr>
  )
}

